import React from "react";
import { Route, redirect } from "react-router-dom";

const AppRouter = () => {
  return (
    <Switch>
      <Route path="/auth" component={Auth} />
      <Route path="/admin" component={Admin} />
      <Route path="/" component={Home} />
      <Redirect to="/" />
    </Switch>
  );
};

export default AppRouter;
